            {"statusCode":200,"body":"{\"segments\": [{\"start\": 2.799999952316284, \"end\": 14.979999542236328, \"text\": \" I sit and wait, does an angel contemplate my fate?\"}, {\"start\": 20.7372, \"end\": 28.239999771118164, \"text\": \" Do they know the places where we go when we're grey and old?\"}, {\"start\": 29.059999465942383, \"end\": 44.68000030517578, \"text\": \" Cause I have been told that salvation lets their wings unfold\"}, {\"start\": 47.4407, \"end\": 49.619998931884766, \"text\": \" So when I'm lying in my bed, thoughts runnin' through my head\"}, {\"start\": 49.720001220703125, \"end\": 59.86000061035156, \"text\": \" And I feel that love is dead, I'm lovin' angels instead\"}, {\"start\": 59.86000061035156, \"end\": 70.26000213623047, \"text\": \" And through it all, she offers me protection, a lot of love and affection\"}, {\"start\": 70.26000213623047, \"end\": 77.80000305175781, \"text\": \" Whether I'm right or wrong, and down the waterfall, wherever it may take me\"}, {\"start\": 77.80000305175781, \"end\": 90.68000030517578, \"text\": \" I know that life won't break me, when it comes to call, she won't forsake me\"}, {\"start\": 90.68000030517578, \"end\": 93.66000366210938, \"text\": \" I'm lovin' angels instead\"}, {\"start\": 95.5199966430664, \"end\": 108.54000091552734, \"text\": \" When I'm feelin' weak and my pain walks down a one-way street\"}, {\"start\": 108.54000091552734, \"end\": 117.30000305175781, \"text\": \" I look above and I know I'll always be blessed with love\"}, {\"start\": 120.80000305175781, \"end\": 128.44000244140625, \"text\": \" And as the feelin' grows, she breathes flesh to my bones\"}, {\"start\": 131.35, \"end\": 139.17999267578125, \"text\": \" And when love is dead, I'm lovin' angels instead\"}, {\"start\": 139.44000244140625, \"end\": 144.63999938964844, \"text\": \" And through it all, she offers me protection, a lot of love and affection\"}, {\"start\": 144.9199981689453, \"end\": 155.7200012207031